import React from 'react';



function sum(a,b){
 return (a+b);
} 
function sub(a,b){
 return (a-b);
}
function mul(a,b){
return (a*b);
}
function dev(a,b){
    return (a/b);

}
  
 export {sum,dev,mul ,sub,};
